INSERT INTO `drugs` VALUES (2,'Аналгин',0000000008,'После приема внутрь метамизол натрия быстро гидролизуется в желудочном соке с образованием активного метаболита 4-метил-амино-антипирина, который после всасывания метаболизируется в 4-формил-амино-антипирин и другие метаболиты.',0,500,100.00),(3,'Аласенс',0000000030,'Накопление протопорфирина IX в опухоли происходит в течение 3-6 часов после приема растфора аминолевулиновой кислоты внутрь и 1-3 ч после проведения инстилляции. Затем уровень протопорфирина IX в опухоли постепенно снижается, достигая исходных значений через 24-48 ч после приема аминолевулиновой кислоты.',1,1.5,30.00),(4,'Бисептол',0000000020,'Комбинированный антибактериальный препарата, содержащий сульфаметоксазол, обладающий средней длительностью действия, тормозящий синтез фолневой кислоты путем конкурентного антагонизма с парааминобензойной кислотой.',1,80,22.50),(5,'Парацетамол',0000000015,'Анальгетик-антипиретик. Обладает анальгезирующим, жаропонижающим и слабым противовоспалительным действием. Механизм действия связан с ингибированием синтеза простагландинов, преимущественным влиянием на центр терморегуляции в гипоталамусе.',0,10,22.00),(6,'Парацетамол',0000000023,'Парацетамол - анальгетик-антипиретик. Обладает анальгезирующим, жаропонижающим и слабым противовоспалительным действием. Механизм действия связан с ингибированием синтеза простагландинов, преимущественным влиянием на центр терморегуляции в гипоталамусе.',0,120,12.00),(9,'Кетанов',0000000012,'НПВС, оказывает выраженное анальгезирующее (обезболивающее) действие, обладает также противовоспалительным и умеренным жаропонижающим действием.',0,10,23.00),(10,'Фервекс',0000000022,'Фервекс для детей - комбинированный препарат, который содержит парацетамол, фенирамина малеат и аскорбиновую кислоту.',0,280,120.00);
